import { useNavigate } from "react-router-dom";
import "../App.css";

function UserHome() {
  const navigate = useNavigate();

  const createFlight = () => {
    navigate("/admin/flightCRUD");
  };

  const logout = () => {
    navigate(-1);
  };

  return (
    <div>
      <div className="HeaderContainer">
        <div className="HeaderButton">
          <button onClick={logout}>Logout</button>
        </div>
        <div className="Home">
          <h1>Home</h1>
          <h2>Welcome User</h2>
        </div>
      </div>
      <div className="App">
        <div className="UserHomeButtons">
          <button onClick={createFlight}>Reserve Flights</button>
        </div>
      </div>
    </div>
  );
}

export default UserHome;
